import React from 'react';

const Entry = (props) => {
    return (
        <div>
            <h2 href="#">{props.data.title}</h2>
            <p>{props.data.authors.join(', ')}</p>
            <p>Published {props.data.published}</p>
            <p>Summary: {props.data.summary}</p>
            <p></p>
        </div>
    )
}


export default Entry;
